import logo from './logo.svg';
import './App.css';
import { Button } from '@material-ui/core';
import PropTypes from 'prop-types';






const DopComponent = ({ helloText, count, isAdmin }) => {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                    {helloText}
                </p>
                <a
                    className="App-link"

                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
        </a>

                <div className="but">
                    <Button variant="outlined" color="secondary" onClick={incrementClick}>PLUS </Button>
                    <Button variant="outlined" color="secondary" onClick={incrementClickTwo}>Minus</Button>
                </div>
                <div className="but1">
                    {count}
                </div>
            </header>
            <div>

            </div>
        </div>
    );
}


DopComponent.propTypes = {

    count: PropTypes.number.isRequired,

    helloText: PropTypes.string.isRequired,
    isAdmin: PropTypes.bool.isRequired
}



export default DopComponent;
